import React from 'react';
import { useNavigate } from 'react-router-dom';
import { motion } from 'framer-motion';

function Home() {
  const navigate = useNavigate();

  return (
    <div className="flex flex-col items-center justify-center h-screen bg-gray-100">
      <motion.h1 
        initial={{ y: -50, opacity: 0 }}
        animate={{ y: 0, opacity: 1 }}
        transition={{ duration: 0.5 }}
        className="text-4xl font-bold text-gray-800 mb-8"
      >
        Welcome to the App
      </motion.h1>

      <motion.button
        whileTap={{ scale: 0.95 }}
        whileHover={{ backgroundColor: "#3b82f6" }}
        onClick={() => navigate('/profile')}
        className="w-64 px-6 py-3 bg-blue-500 text-white rounded-lg shadow-lg mb-4 transition duration-300"
      >
        Go to Profile
      </motion.button>

      <motion.button
        whileTap={{ scale: 0.95 }}
        whileHover={{ backgroundColor: "#10b981" }}
        onClick={() => navigate('/todo')}
        className="w-64 px-6 py-3 bg-green-500 text-white rounded-lg shadow-lg transition duration-300"
      >
        Go to To-Do List
      </motion.button>
    </div>
  );
}

export default Home;
